export class Ally {
    constructor(id, name, tag, playerCount, points, rank, bashpoints, bashpointsRank) {
        this.id = id;
        this.name = name;
        this.tag = tag;
        this.playerCount = playerCount;
        this.points = points;
        this.rank = rank;
        this.bashpoints = bashpoints;
        this.bashpointsRank = bashpointsRank;
    }
}
